import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createGlobalStyle } from 'styled-components';
import AIThemeGenerator from './services/AIThemeGenerator';
import SmartChatbot from './components/Chatbot';
import AIDashboard from './components/IrrigationDashboard'; // Assuming you will create this component
import './App.css';
import Navigation from './components/Navigation';
import IrrigationDashboard from './components/IrrigationDashboard';
import Chatbot from './components/Chatbot';
import Iot from './components/Iot';

const App = () => {
const aiTheme = {
  colors: {
    primary: '#508578', // Dark Green
    secondary: '#A0D2B7', // Light Green
    accent: '#64B5F6', // Blue
    background: '#F2F2F2', // Light Gray
    text: '#333333', // Dark Gray
    brown: '#A0522D', // Brown
  },
  fonts: {
    primary: 'Roboto, sans-serif',
  },
  borderRadius: '8px',
};

  return (
    <ThemeProvider theme={aiTheme}>
      <Router>
        <div className="app-container">
          <Navigation />
          <main className="main-content">
            <Routes>
              <Route path="/" element={<SmartChatbot />} />
              <Route path="/irrigation-dashboard" element={<AIDashboard />} />
              <Route path="/Iot" element={<Iot />} />
            </Routes>
          </main>
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
